import React from 'react';
import { Segment, Card, TextArea, Button} from 'semantic-ui-react';


const items = [
  {
    header: 'General Stats',
    description: '',
  },
  {
    header: 'Vunerabilties',
    description: '0 discovered',
  }
  ]


class landingPageSection2 extends React.Component{

	state ={
		generalStats: items[0],
		Vunerabilties: items[1],
		gasCosts:items[2]
	}


	render(){
	return (
			<Segment>
			 	<Button primary style = {{width : '250px'}} >Run Audit</Button>
			 	<br/>
			 	<br/>

				<Card.Group >

						<Card>
					      <Card.Content
					        header={this.state.generalStats.header}
					        description={this.state.generalStats.description}

					      />
					    </Card>

					    <Card>
					      <Card.Content
					        header={this.state.Vunerabilties.header}
					        description={this.state.Vunerabilties.description}
					      />
					    </Card>

					    						<Card>
					      <Card.Content
					        header={this.state.generalStats.header}
					        description={this.state.generalStats.description}

					      />
					    </Card>

					    <Card>
					      <Card.Content
					        header={this.state.generalStats.header}
					        description={this.state.generalStats.description}
					      />
					    </Card>

				</Card.Group>
		 </Segment>
		)
	}
}

export default landingPageSection2;
